<!DOCTYPE html>
<html>
<head>
	<title>mapTK</title>
	<meta charset="utf-8" />
	<meta name="viewport" content="width=device-width, initial-scale=1.0">
	<link rel="stylesheet" href="http://cdn.leafletjs.com/leaflet-0.7.3/leaflet.css" />
	<script src="http://cdn.leafletjs.com/leaflet-0.7.3/leaflet.js"></script>
	<style type="text/css">
		body {
			padding: 0;
			margin: 0;
		}
		html, body, #map {
			height: 100%;
		}
		table, td {
			border-collapse: collapse;
			border-style: solid;
			border-width: 1px;
			border-color: #e9e9e9;
			padding: 5px;
		}
		.evenrowcol{
			background-color: #f6f6f6;
		}
		.legend {
			padding: 6px 8px;
			font: 14px/16px Arial, Helvetica, sans-serif;
			background: white;
			background: rgba(255,255,255,0.8);
			box-shadow: 0 0 15px rgba(0,0,0,0.2);
			border-radius: 5px;
			line-height: 18px;
			color: #555;
		}
		.legend i {
			width: 18px;
			height: 18px;
			float: left;
			margin-right: 8px;
		}
		.legend table, .legend td {
			border: none;
		}
		.value {
			border: none;
			padding: 0px 0px 0px 8px;
			text-align: left;
			vertical-align: middle;
		}
		.circle {
			border: none;
			padding: 0px;
			text-align: center;
			vertical-align: middle;
		}
		.shape {
			padding: 0px;
			text-align: center;
			vertical-align: middle;
		}
		.ln {
			stroke: #0033ff;
			stroke-width: 5;
			stroke-opacity: 0.5;
			stroke-linecap: round;
		}
		.plgn {
			fill: #0033ff;
			fill-opacity: 0.5;
			stroke: #0033ff;
			stroke-width: 4;
			stroke-opacity: 0.5;
			stroke-linejoin: round;
		}
		.legend i {
			opacity: 0.5;
		}				
	</style>
</head>

		function onEachFeature(feature, layer) {
			if (feature.properties &&  feature.properties.name && feature.properties.value) {

					"<tr class='evenrowcol'><td>value: </td><td>"+feature.properties.value+"</td></tr>" +
					"</table>"
				);
			}
		}

		// styling
		function getValue(x) {
			return x > 10000 ? "#808080" :
			       x > 10000 ? "#FF0000" :
			       x > 2488 ? "#FF4000" :
			       x > 3194 ? "#FF8000" :
			       x > 1000 ? "#FFBF00" :
			       x > 500 ? "#FFFF00" :
			       x > 7 ? "#FFFF80" :
			       "#808080";
		}			
		function style1(feature) {
			return {
				"color": getValue(feature.properties.value),

				"weight": 1, "fillOpacity": 0.5
			};
		}

		// data layers
        var fitBounds = true; 		
		function addDataToMap(data, style) {
			var dataLayer = L.geoJson(data, {

				style: style,
			});
			dataLayer.addTo(map);
			
			if(fitBounds) {
				map.fitBounds(dataLayer.getBounds());
				fitBounds = false;
			}
		};
